const addUser = ({handler,add}) => {
    return(
        <div className='pa2'>
        
        <input
          id='name'
          className='pa3 ba b--green bg-lightest-blue'
          type='text'
          name='name'
          placeholder='Name'
          onChange={handler}
         
          
        />
        <input
          className='pa3 ba b--green bg-lightest-blue'
          type='text'
          name='userName'
          placeholder='User Name'
          onChange={handler}
          
        />
        <input
          className='pa3 ba b--green bg-lightest-blue'
          type='email'
          name='email'
          placeholder='Email'
          onChange={handler}
          
          
        />

        <button onClick={document.querySelector("#name").textContent("gg")}>Sumbet</button>

        
    </div>
    );
}

export default addUser;
